syntax = "proto3";
package persistence.schema.test_types.v1beta1;

import "third_party/proto/cosmos_proto/cosmos.proto";
import "third_party/proto/gogoproto/gogo.proto";
import "google/protobuf/any.proto";

option go_package = "schema/test_types";
option (gogoproto.goproto_getters_all) = false;



message transactions {
  repeated google.protobuf.Any transactionList = 1 [(comsos_proto.accepts_interface) = "helpers.Transaction"];
}